import React from "react";
import { Navbar, Row } from 'react-materialize';
import { NavLink } from 'react-router-dom';
import ifsc from '../../imagens/ifsc.png';
import epagri from '../../imagens/epagri.png';
import fapesc from '../../imagens/fapesc.png';
import '../logos/logos.css';

const Header = () => (
    <Row>
        <Navbar className="grey darken-3">
          <div class="nav-wraper">
            <li><NavLink to="/" class="brand-logo">Home</NavLink></li>
            <li><NavLink to="informacoes" class="brand-logo">Informações</NavLink></li>
            <li><NavLink to="imagens" class="brand-logo">Galeria de Imagens</NavLink></li>
            <li><NavLink to="videos" class="brand-logo">Vídeos</NavLink></li>
            <li><NavLink to="login" class="brand-logo">Monitoramento</NavLink></li>

            <ul class="right hide-on-med-and-down">
            <img src={ifsc} className="ifsc responsive-img"></img>
            <img src={epagri} className="epagri responsive-img"></img>
            <img src={fapesc} className="fapesc responsive-img"></img>
            </ul>
          </div>
        </Navbar>
    </Row>
);

export default Header;
